spring:
  application:
    name: discovery
server:
  port: 8761
eureka:
  client:
    register-with-eureka: false
    fetch-registry: false
    service-url:
      defaultZone: http://localhost:8761/eureka/
  server:
    enable-replicated-request-compression: false
    eviction-interval-timer-in-ms: 5000